import React from 'react'

import StyledContainer from './container.styles.jsx'
import { node, string } from 'prop-types'

const Container = ({children, isEqualWidth, isEqualHeight, flexDirection, backgroundColor, display, justifyContent, alignItems, boxSizing, padding,boxShadow,position, zIndex, isEqualDirection, ...props}) => (
    <StyledContainer 
        display={display}
        justifyContent={justifyContent}
        alignItems={alignItems} 
        flexDirection={flexDirection}
        isEqualHeight={isEqualHeight} 
        isEqualWidth={isEqualWidth} 
        backgroundColor={backgroundColor}
        boxSizing={boxSizing}
        padding={padding}
        boxShadow={boxShadow}
        position={position}
        zIndex={zIndex}
        isEqualDirection={isEqualDirection}
        {...props}>
        { children }
    </StyledContainer>
)

Container.propTypes = {
    children: node.isRequired,
    display: string,
    flexDirection: string,
    justifyContent: string,
    alignItems: string,
    isEqualWidth: string,
    isEqualHeight: string,
    backgroundColor: string,
    boxSizing: string,
    padding: string,
    boxShadow: string
}

export default Container
